import AuthModel from '../components/AuthModel';


const Nav = ({ showModal }) => {

    const handleClick = () => {
        console.log("log in clicked");
    };

    return (
        <>
            <nav>
                <div className="logo-container">
                    <img
                        className="logo"
                        src={colorLogo}
                        alt="logo" />
                </div>
                {< button className='nav-button' 
                onClick={handleClick} 
                disabled = {showModal}
                > Log in</button>}

{showModal && (
                    <>
                       <AuthModel />
                   </>
               )}

            </nav></>
    );


}

export default Nav;
